import { Button } from "@mui/material";
import Shell from "./Shell";

function Intro() {
  return (
    <Shell
      heading="Welcome to Coterie"
      subheading="Click the button below to get started"
      content={<Button variant="text">Get Started</Button>}
    />
  );
}

export default Intro;
